			align-items: center;
			justify-content: center;
			background-color: #101b21;
			height: 4rem;

			color: #f7f7f7;
			text-transform: uppercase;

			line-height: 31px;
		}

			position: absolute;

			top: 80px;
			right: 10px;
			flex-direction: column;
		}

			border-radius: 20px;
			width: 206px;
			height: auto;
			margin: 5px 0;
		}

			width: 200px;
			height: auto;
			margin: 5px 0;
			text-align: center;
		}

			justify-content: center;
		}

			border-width: 2px;
			border-radius: 10px;
			padding: 10px;
		}
		.options {
			flex-direction: column;
			min-width: 820px;
			max-width: 1154px;
			margin: 0 auto 20px;
			border-style: solid;
			border-color: #ff8400;
			border-radius: 10px;
			border-width: 1px;
			padding: 10px;
		}

			color: #ffbf36;
			text-decoration: none;
		}
		a:hover {
			color: #ffbf36;

		input {

			background-color: #162028;
			border-color: #304556;
			border-style: solid;
			max-width: 210px;
			display: inline-block;
			margin-bottom: 0;
			margin-right: 0.6rem;
			padding: 2px 6px;
			outline: none;
			text-transform: uppercase;
		}

			display: inline-block;
			padding: 5px 10px;
			cursor: pointer;
			text-transform: uppercase;
			background-color: rgb(9, 89, 113);
			color: #fff;
			border: none;
		}

			color: #fff;
			background-color: rgb(7, 71, 90);

		function CreateProcNameOptions() {
			var select = document.createElement('select')
			for (var j = 0; j < PROCNAME_FIRST_3_CHARS.length; j++) {
				var option = document.createElement('option')
				option.value = PROCNAME_FIRST_3_CHARS[j]
				option.innerHTML = PROCNAME_FIRST_3_CHARS[j].charAt(0).toUpperCase() + PROCNAME_FIRST_3_CHARS[j].slice(1) + " ..."
				select.appendChild(option)
			}
			document.getElementById("name_format_options").appendChild(select)
		}
		
	
		function NameFormatChanged() {
			document.getElementById("name_format_options").innerHTML = ""
			
			var name_format = document.getElementById("name_format").value
			const words = name_format.split(" ");
			
			for (var i = 0; i < words.length; i++) {
				var word = ""
				var append_s = false
				if (words[i].includes("'s")) {
					word = words[i].replace("'s","")
					append_s = true
				} else {
					word = words[i]
				}
				word = word.replace(" ","")
				
				if (SHIP_NAME_TABLE[word]) {
					var select = document.createElement('select')
					for (var j = 0; j < SHIP_NAME_TABLE[word].length; j++) {
						var option = document.createElement('option')
						option.value = SHIP_NAME_TABLE[word][j]
						option.innerHTML = SHIP_NAME_TABLE[word][j]
						select.appendChild(option)
					}
					document.getElementById("name_format_options").appendChild(select)
				} 
				else if (word == "SHIPCODE") {
					for (var x = 0; x < 2; x++) {
						var select = document.createElement('select')
						for (var j = 0; j < 26; j++) {
							var option = document.createElement('option')
							option.value = String.fromCharCode(65 + j)
							option.innerHTML = String.fromCharCode(65 + j)
							select.appendChild(option)
						}
						document.getElementById("name_format_options").appendChild(select)
					}
					var select = document.createElement('select')
					for (var j = 0; j < 9; j++) {
						var option = document.createElement('option')
						option.value = String.fromCharCode(49 + j)
						option.innerHTML = String.fromCharCode(49 + j)
						select.appendChild(option)
					}
					document.getElementById("name_format_options").appendChild(select)
				}
				else if (word == "NUMERAL") {
					var NUMERALS = ["II","III","IV","IX","V","VI","VII","VIII","X","XI","XII","XIII","XIV","XIX","XV","XVI","XVII","XVIII"]
					var select = document.createElement('select')
					for (var j = 0; j < NUMERALS.length; j++) {
						var option = document.createElement('option')
						option.value = NUMERALS[j]
						option.innerHTML = NUMERALS[j]
						select.appendChild(option)
					}
					document.getElementById("name_format_options").appendChild(select)
				}
				else if (word == "PROCNAME") {
					CreateProcNameOptions()
				}
				else {
					const textElement1 = document.createElement('span')
					textElement1.textContent = word + " "
					document.getElementById("name_format_options").appendChild(textElement1)
				}
				
				if (append_s) {
					var textElement2 = document.createElement('span')
					textElement2.textContent = "'s "
					document.getElementById("name_format_options").appendChild(textElement2)
				}
				//console.log()
			}
		}
		
		document.getElementById("name_format").addEventListener("change", NameFormatChanged)
		NameFormatChanged()
		
		
		
		
		
		function chunkValue(str) {
		  let result = 0;
		  for (let i = 0; i < str.length; i++) {
			const byteValue = str.charCodeAt(i);
			result = (result << 8) + byteValue;
		  }
		  return result;
		}
		
		function compare_chunk(subject, comparand) {
			var our_chunk = chunkValue(subject)
			var cmp_chunk = chunkValue(comparand)
			//console.log(our_chunk + " " + cmp_chunk)
			
			if (our_chunk > cmp_chunk) {
				return 'ja'
			}
			else if (our_chunk == cmp_chunk) {
				return 'jz'
			}
			else {
				return 'jl'
			}
		}
		
		function IsDict(jsonObject) {
			const alphabetRegex = /[a-zA-Z]/
			const keys = Object.keys(jsonObject)
			for (let i = 0; i < keys.length; i++) {
				if (alphabetRegex.test(keys[i])) {
					return true
				}
			}
			return false
		}

		function parse_branch(data, chunk) {
			console.log(data)
			if (IsDict(data)) {
				for (letter in data) {
					console.log("XXXX")
					return letter
					//
				}
			} else {
				for (var i = 0; i < data.length; i++) {
					var check_chunk = data[i][0]
					var sub_data = data[i][1]
					//console.log(sub_data)
					var jump_type = data[i][2]
					//console.log(compare_chunk(chunk, check_chunk) + " " + jump_type)
					if (compare_chunk(chunk, check_chunk) == jump_type) {
						return parse_branch(sub_data, chunk)
					}
				}
			}
		}
			
		function gen_next_char(chunk) {
			var first_char = chunk.charAt(0)
			var branch = LETTER_MAP["5"]
			var letter_branch = branch[first_char]
			var letter = parse_branch(letter_branch, chunk)
			return letter
		}
